-- ----------------------------
-- Table structure for `druglist`
-- ----------------------------
DROP TABLE IF EXISTS `druglist`;
CREATE TABLE `druglist` (
  `id` bigint(255) unsigned NOT NULL AUTO_INCREMENT,
  `general_Chinese_name` varchar(255) DEFAULT NULL COMMENT '通用中文名称',
  `drug_registration_name` varchar(255) DEFAULT NULL COMMENT '药品注册名称',
  `fee_grade` varchar(255) DEFAULT NULL COMMENT '项目收费等级',
  `major_coding` varchar(255) DEFAULT NULL COMMENT '大类编码',
  `dosage_form` varchar(255) DEFAULT NULL COMMENT '剂型',
  `national_essential_drugs` int(1) DEFAULT NULL COMMENT '是否国家基本药物。1是0否',
  `ATC_code` varchar(255) DEFAULT NULL COMMENT '药品ATC代码',
  `count` int(11) DEFAULT '0' COMMENT '搜索次数',
  PRIMARY KEY (`id`),
  UNIQUE KEY `drug_registration_name` (`drug_registration_name`(191)) USING BTREE,
  KEY `general_Chinese_name` (`general_Chinese_name`(191)) USING BTREE,
  KEY `count` (`count`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=36321 DEFAULT CHARSET=utf8mb4;

