-- ----------------------------
-- Table structure for `files`
-- ----------------------------
DROP TABLE IF EXISTS `files`;
CREATE TABLE `files` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT '主键，自增',
  `filename` varchar(255) NOT NULL DEFAULT '' COMMENT '文件名',
  `filepath` varchar(255) NOT NULL DEFAULT '' COMMENT '文件路径',
  `type` varchar(255) NOT NULL DEFAULT '' COMMENT '上传的文件type参数',
  `ticketID` varchar(255) NOT NULL DEFAULT '' COMMENT '上传的文件ticketID参数',
  `uploadtime` varchar(255) DEFAULT '' COMMENT '文件上传时间，即接收到图片的时间',
  `submittime` varchar(255) DEFAULT '' COMMENT '录单提交时间',
  `content` text COMMENT '提交内容',
  `realname` varchar(255) DEFAULT '' COMMENT '录单人员姓名',
  `status` int(11) NOT NULL DEFAULT '0' COMMENT '处理状态：0待领取，1待处理，2待质检，3被驳回，4已完成',
  `userid` int(11) DEFAULT '0' COMMENT '领取人员id',
  `userid2` int(11) DEFAULT '0' COMMENT '质检人员id',
  `submittime2` varchar(255) DEFAULT '' COMMENT '质检提交时间',
  `pushtime` varchar(255) DEFAULT '' COMMENT '推送数据时间',
  `realname2` varchar(255) DEFAULT '' COMMENT '质检人员姓名',
  `remark` text COMMENT '备注',
  `source` int(11) DEFAULT '1' COMMENT '录单员任务来源：1领取，2派发',
  `gettasktime` varchar(255) DEFAULT '' COMMENT '领取或者派发任务的时间',
  `channelCode` varchar(255) DEFAULT '' COMMENT '渠道码',
  `appKey` varchar(255) DEFAULT '',
  `reportno` varchar(255) DEFAULT '' COMMENT '报案号',
  `titlename` varchar(255) DEFAULT '' COMMENT '图片标题',
  `sendback` int(11) DEFAULT '0' COMMENT '退件：0否，1是',
  `checkedList1` text,
  `checkedList2` text,
  `repush` int(255) DEFAULT '0' COMMENT '是否重推：0否，1是',
  `repushcontent` text COMMENT '重推内容',
  `repushtime` varchar(255) DEFAULT '' COMMENT '重推时间',
  `imgmd5` varchar(255) DEFAULT '' COMMENT '图片的MD5',
  `reinput` int(11) DEFAULT '0' COMMENT '是否补录：0否，1是',
  `reinputremark` varchar(255) DEFAULT '' COMMENT '补录原因',
  `reinputtime` varchar(255) DEFAULT '' COMMENT '补录时间',
  `bill_type` int(11) DEFAULT '0' COMMENT '1门诊，2住院',
  `invoice_type` int(11) DEFAULT '0' COMMENT '1发票，2清单，3其他',
  `rows` int(11) DEFAULT '0' COMMENT '细项明细行数',
  PRIMARY KEY (`id`),
  KEY `filename` (`filename`) USING BTREE,
  KEY `ticketID` (`ticketID`) USING BTREE,
  KEY `uploadtime` (`uploadtime`) USING BTREE,
  KEY `status` (`status`) USING BTREE,
  KEY `realname` (`realname`) USING BTREE,
  KEY `userid` (`userid`) USING BTREE,
  KEY `userid2` (`userid2`) USING BTREE,
  KEY `reportno` (`reportno`) USING BTREE,
  KEY `imgmd5` (`imgmd5`) USING BTREE
) ENGINE=MyISAM AUTO_INCREMENT=6117 DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of files
-- ----------------------------

