CREATE TABLE `filestore` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT '主键，自增',
  `fileid` int(10) DEFAULT '0' COMMENT 'fileid',
  `item_name` varchar(255) DEFAULT '' COMMENT '明细项目名称',
  `count` varchar(255) DEFAULT '' COMMENT '明细项目数量',
  `unit_price` varchar(255) DEFAULT '' COMMENT '明细项目单价',
  `item_amount` varchar(255) DEFAULT '' COMMENT '项目金额',
  `class` varchar(255) DEFAULT '' COMMENT '明细项目等级',
  `manual_proportion` varchar(255) DEFAULT '' COMMENT '手动调整比例',
  `manual_amount` varchar(255) DEFAULT '' COMMENT '手动调整金额',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=44 DEFAULT CHARSET=utf8;

