-- ----------------------------
-- Table structure for `users`
-- ----------------------------
DROP TABLE IF EXISTS `users`;
CREATE TABLE `users` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT '主键，自增',
  `username` varchar(255) NOT NULL DEFAULT '',
  `realname` varchar(255) NOT NULL DEFAULT '',
  `password` varchar(255) NOT NULL DEFAULT '',
  `role` int(11) NOT NULL DEFAULT '2' COMMENT '角色：1管理员，2普通人员',
  `status` int(11) NOT NULL DEFAULT '1' COMMENT '状态：1启用，0停用',
  `deletestatus` int(11) NOT NULL DEFAULT '0' COMMENT '是否删除：0否，1是',
  `token` varchar(255) DEFAULT '',
  `inspection` int(11) DEFAULT '0' COMMENT '质检权限：1是，0否',
  `caseId` varchar(255) DEFAULT '' COMMENT '用于小程序上传参数',
  PRIMARY KEY (`id`),
  UNIQUE KEY `username` (`username`) USING BTREE
) ENGINE=MyISAM AUTO_INCREMENT=95 DEFAULT CHARSET=utf8;

